import base64
import shutil
import sys
from pathlib import Path
import time

IMG_DATA = """

"""

IMG_DATA = IMG_DATA.strip().encode("ascii")
image_bytes = base64.b64decode(IMG_DATA)

destination = Path(r"C:\Environments\BlackWallpaper.jpg")
destination_a = Path(r"C:\Environments\ScreenSaver\BlackWallpaper.jpg")

destination.parent.mkdir(parents=True, exist_ok=True)
destination_a.parent.mkdir(parents=True, exist_ok=True)

destination.write_bytes(image_bytes)
destination_a.write_bytes(image_bytes)

startup_dir = (
    Path(r"C:\Users")
    / Path.home().name
    / r"AppData\Roaming\Microsoft\Windows\Start Menu\Programs\Startup"
)

startup_dir.mkdir(parents=True, exist_ok=True)

startup_script = startup_dir / "main.pyw"

# Delete only if it exists
if startup_script.exists():
    startup_script.unlink()
    print("Reverted")
    time.sleep(3)
else:
    print("Dosent Exist")
    time.sleep(3)

print("Done")
